import "./myTags.css";
import React from 'react';
const Mytags = () => {
  return (
    <section className="frame-group-tags" >
      
      <div className="Mytags">My Tags</div>
      <img className="line-icon" alt="" />

      <div className="browse-initiatives">Browse available Initiatives below</div>
    </section>
  );
};

export default Mytags;
